import React, { useState, useEffect } from 'react';

function View1() {
    const [data, setData] = useState([{}]);

    useEffect(() => {
        fetch("/view1").then(
            res => res.json()
        ).then(
            data => {
                setData(data)
            }
        )
    }, [])

    return (
        <div>
            <form onSubmit={this.handleSubmit} method='POST'>
                <input type='text' id="username" />
                <input type='submit' value="submit" />
            </form>
            <p>Hello! {data.User}</p>
        </div>
    )
}

export default View1;
